                await eventListener.AssertMinimumLength(nameof(clusterName),clusterName,1);
                await eventListener.AssertMaximumLength(nameof(clusterName),clusterName,90);
                await eventListener.AssertRegEx(nameof(clusterName),clusterName,@"^[a-zA-Z][-\w\._\(\)]+[a-zA-Z0-9]$");
                await eventListener.AssertNotNull(nameof(body), body);
                await eventListener.AssertObjectIsValid(nameof(body), body);
            }
        }
    }
}